public class Solution {
    public int MinimumIndex(IList<int> nums) {
        int dominant = nums[0], n = nums.Count, freq = 1, half = n / 2;
        for (int i = 1; i < n; i++) {
            if (nums[i] == dominant) freq++;
            else if (--freq == 0) {
                dominant = nums[i];
                freq = 1;
            }
        }

        freq = 0;
        foreach (int num in nums) {
            if (num == dominant) freq++;
        }

        if (freq <= half) return -1;

        int leftFreq = 0;
        for (int i = 0; i < n - 1; i++) {
            if (nums[i] == dominant) leftFreq++;
            if (leftFreq > (i + 1) / 2 && (freq - leftFreq) > (n - i - 1) / 2) return i;
        }

        return -1;
    }
}
